import React from "react";
import { Link } from "react-router-dom";

export default () => {
  return (
    <div className="home page-main__wrapper">
      <header className="main__header">
        <div className="logo__wrapper">
          <p className="logo__text">ThePortfolio</p><img src="ThePortfolio_Creator_Logo_6.png" alt="Logo" className="logo" /><p className="logo__text">Creator</p>
        </div>

        <nav className="main__nav">
          <button>Home</button>
          <button>SignUp</button>
          <button>Login</button>
        </nav>
      </header>
    </div>
  )
}

